  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-size: 14px;
      font-family: sans-serif;
      font-size: 102.00% !important;
      line-height: 177.86% !important;
    }

    body {
      font-family: Arial, 'Helvetica Neue', Helvetica, sans-serif;
      overflow: hidden;
      width: 100%;
      max-width: 600px;
      margin: 0 auto;
      background: #000;
      color: #fff
    }

    .wrapper {
      padding: 0 20px;
      margin: auto
    }

    .main .wrapper {
      display: flex;
      flex-direction: column;
      min-height: calc(100vh - 80px)
    }

    .header {
      padding: 15px 0;
      border-bottom: 2px solid #2f3032
    }

    .header .wrapper {
      display: flex;
      justify-content: space-between;
      align-items: center
    }

    .header__box {
      background: #c4c4c4;
      padding: .7rem;
      border-radius: 4px;
      height: 50px;
      width: 50px;
      display: flex;
      align-items: center;
      justify-content: center
    }

    .main {
      background: #0a0a0a;
      min-height: calc(100vh - 82px);
      padding: 20px 0
    }

    .main__container {
      padding: 20px 15px;
      background: #28292b;
      margin-bottom: 16px;
      font-size: 25px;
      font-weight: 700;
      color: #fff;
      text-align: center
    }

    .main h1 {
      font-weight: 400;
      margin-bottom: 16px;
      font-size: 36px
    }

    .main__img {
      position: relative;
      display: flex;
      justify-content: center;
      margin-bottom: 25px;
      overflow: hidden;
      flex: 1 1 auto;
      min-height: 250px
    }

    .main__img img {
      width: 100%;
      filter: blur(30px)
    }

    .pl {
      display: flex;
      flex-grow: 1;
      margin-top: 10px;
      min-height: 212px;
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: 2
    }

    .pl__cnt {
      background-size: contain;
      background-position: center center;
      background-repeat: no-repeat;
      flex-grow: 1
    }

    .pl__cnt {
      align-items: center;
      display: flex;
      justify-content: center;
      position: relative
    }

    .pl__ctr {
      align-items: center;
      bottom: 0;
      display: flex;
      height: 50px;
      position: absolute;
      width: 100%
    }

    .pl__ctr-tm {
      font-size: 11px;
      margin: 0 20px 0 15px
    }

    .pl__ctr-bar {
      background-color: #3f3f3f;
      flex-grow: 1;
      height: 2px;
      margin-right: 15px;
      position: relative
    }

    .pl__ctr-bar:before {
      background-color: #fff;
      border-radius: 50%;
      content: '';
      cursor: pointer;
      height: 16px;
      left: -8px;
      position: absolute;
      top: -8px;
      width: 16px;
      z-index: 1
    }

    .pl__ctr-bar-line {
      -webkit-animation: a 5s both;
      animation: a 5s both;
      background-color: #9f9f9f;
      height: 100%;
      left: 0;
      position: absolute;
      transform-origin: left;
      width: 85%
    }

    .pl__ctr-ic {
      cursor: pointer;
      fill: #fff
    }

    .pl__ctr-ic.hd {
      background-color: #000;
      border-radius: 4px;
      fill: #b6d4f0;
      height: 16px;
      width: 33px
    }

    .pl__ctr-ic.mute {
      height: 14px;
      margin: 0 15px
    }

    .pl__ctr-ic.resize {
      height: 18px;
      margin-right: 15px
    }

    .lst__t {
      font-size: large;
      font-weight: 700;
      padding: 0 10px
    }

    .lst__w-i {
      display: flex
    }

    .lst__i {
      background: #292929;
      border-radius: 4px;
      margin: 5px;
      padding: 7px;
      width: 100%;
      overflow: hidden
